import React from "react";

import "./styles/App.css";

import LandingPage from "./components/main/LandingPage";
import Routes from "./components/general/Routes";
import {BrowserRouter} from "react-router-dom";

function App() {
    return (
        <BrowserRouter>
            <LandingPage />
            <Routes />
        </BrowserRouter>
  );
}

export default App;
